import { useEffect, useState } from "react";

const Home = () => {
    let[product,setProduct]=useState()
    useEffect(()=>{
        let fetchData=async()=>{
            let response=await fetch('https://dummyjson.com/products')
            let data= await response.json()
            setProduct(data)
        }
        fetchData()
    },[])
    console.log(product);
    return ( 
        <div className="home">
           <div className="products">
           {product.map((data,id)=>(
            <div className="prod">
                <h1 key={id}>{data}</h1>
            </div>
           ))}
           </div>
        </div>
     );
}
 
export default Home;
